import React, { useEffect } from 'react'
let baseURL = "fakeapi"
function Todos() {
    useEffect(() => {
        // fetch(`${baseURL}/getTodos`)
        //     .then(res => res.json())
        //     .then(data => console.log('data', data))
        fetch(`${baseURL}/getUsers`)
            .then(res => res.json())
            .then(data => console.log('data', data))
    })
    return (
        <div>
            Hello from todos
        </div>
    )
}

export default Todos
